	               join aqopiapp.t_transaction trs

                     on trs.header_rid = h.header_id

     set voorziening.AantalBestaandeSpaartegoeden = v_rows

   where trs.transaction_id = v_transaction_id;         

   

  /*

  // delete empty rows in finsave. (can be created by windows client, they will mess up Aantal-counter)

  */

  delete target

    from hypdatabase.huidiganalysebestaandvermogen target

         join (

           select dataset.ObjectID

             from hypdatabase.t_hypotheek hyp 

                  join hypdatabase.huidigesituatie hs

                    on hs.ObjectRef = hyp.ObjectID

                   and hs.FieldRef = hyp.HSID

                       join hypdatabase.huidiganalysebestaandevoorzieningen voorziening 

                         on voorziening.ObjectRef = hs.ObjectID

                        and voorziening.FieldRef = hs.BestaandeVoorzieningenGegevens

                            join hypdatabase.huidiganalysebestaandvermogen dataset

                              on dataset.ObjectRef = voorziening.ObjectID

                             and dataset.FieldRef = voorziening.BestaandeSpaartegoeden

            where hyp.hypotheekId = a_guid

              and dataset.Omschrijving is null

              and dataset.HuidigeWaarde is null

         ) as dataset

           on dataset.ObjectID = target.ObjectID;   

  

  select v_inserted_rows;

end ;;
