CREATE DEFINER=`finix_owner`@`localhost` PROCEDURE `p_process_mbd_hypotheek`(

  a_guid varchar(255)

)
this_proc:begin

  /*

  // Proc updates latest aqopi values 

  //   of aqopiapp.t_mbd_hypotheek

  //   to hypdatabase.huidiganalyseonderpand of client

  //

  // Log is saved in aqopiapp.t_aqopiapp_hypdatabase

  */

  

  /*

  // Following assumptions:

  // - All lines in t_mbd_hypotheek are loanparts of one mortgage

  // - All loanparts belong to same moneyprovider (bank) (we only inspect the first one)

  // - All loanparts have same accountnumber (we only inspect the first one)

  //

  // and we add some transformation for loantype:

  // Incoming:

  //   Annuiteit, Lineair, Leven, Bankspaarhypotheek, Spaar, Aflosvrij, Krediet, Belegging of Hybride

  // Needed:

  //   {value:0, label:'Aflossingsvrije hypotheek'},

  //   {value:1, label:'Annuiteitenhypotheek'},

  //   {value:2, label:'Lineaire hypotheek'},

  //   {value:3, label:'Krediethypotheek'},

  //   {value:4, label:'Spaarhypotheek'},

  //   {value:5, label:'Levenhypotheek'},

  //   {value:6, label:'Beleggingshypotheek'},

  //   {value:7, label:'Hybridehypotheek'},

  //   {value:8, label:'Unit Linked hypotheek'},

  //   {value:9, label:'Bankspaarhypotheek'},

  //   {value:10, label:'BEW hypotheek'}

  */

  

  declare v_transaction_id int;

  declare v_loanpart_1 int;

  declare v_loanpart_2 int;

  declare v_loanpart_3 int;

  declare v_loanpart_4 int;  

  declare v_interest_1 double;

  declare v_interest_2 double;

  declare v_interest_3 double;

  declare v_interest_4 double;

  declare v_loantype_1 int;

  declare v_loantype_2 int;

  declare v_loantype_3 int;

  declare v_loantype_4 int;

  

  declare exit handler

    for sqlstate '40001' -- (ER_LOCK_DEADLOCK) Retry when deadlock occured

    begin                          

      do sleep(1);

      call aqopiapp.p_process_mbd_hypotheek(a_guid); 

    end;

  

  set max_sp_recursion_depth=255; 

  /*

  // Maak een transactie op basis van de meest recente header van de guid

  */

  insert 

    into aqopiapp.t_transaction 

       (  header_rid

       )

  select aqopi_header.header_id

    from (

	  select max(header_id) as header_id

	       , finsave_guid

	    from aqopiapp.t_header 

	   where data_type = 'MBD'

       group

          by finsave_guid

    ) as aqopi_header

   where aqopi_header.finsave_guid = a_guid;

  

  select last_insert_id() into v_transaction_id;

    

  /*

  // Vul de log met de aqopi-herkomst en het hypdatabase-doel

  */  

  insert

    into aqopiapp.t_aqopiapp_hypdatabase 

       ( header_rid

	   , aqopi_table_name 

	   , aqopi_id

	   , hypdatabase_table_name 

	   , hypdatabase_object_id

	   )

  select trs.header_rid

       , 't_mbd_hypotheek'

       , aqopi.hypotheek_id

       , 'huidiganalyseonderpand'

       , case when hdr.is_partner = 1 then dataset_partner.ObjectID else dataset_client.ObjectID end

    from aqopiapp.t_transaction trs

	     join (

           -- finsave only supports one mortgage loan. we pick the first

           select header_rid

                , min(hypotheek_id) as hypotheek_id

             from aqopiapp.t_mbd_hypotheek aqopi

            group

               by header_rid

         ) as aqopi

	       on aqopi.header_rid = trs.header_rid

         join aqopiapp.t_header hdr

           on hdr.header_id = trs.header_rid

              join hypdatabase.t_hypotheek hyp 

                on hyp.hypotheekId = hdr.finsave_guid

	               join hypdatabase.huidigesituatie hs

	                 on hs.ObjectRef = hyp.ObjectID

	                and hs.FieldRef = hyp.HSID

                        join ( 

                          select ObjectID

                               , ObjectRef

                               , FieldRef

                            from hypdatabase.huidiganalyseonderpand 

                        ) as dataset_client 

                          on dataset_client.ObjectRef = hs.ObjectID

                         and dataset_client.FieldRef = hs.HuidigeWoonsituatieClient

                        join ( 

                          select ObjectID

                               , ObjectRef

                               , FieldRef

                            from hypdatabase.huidiganalyseonderpand 

                        ) as dataset_partner 

                          on dataset_partner.ObjectRef = hs.ObjectID

                         and dataset_partner.FieldRef = hs.HuidigeWoonsituatiePartner

   where trs.transaction_id = v_transaction_id;

    

  /*

  // Bepaal loanparts 1 - 4

  */

  select aqopi_detail.eindstand 

       , aqopi_detail.rentepercentageBerekend

       , case 

           when aqopi_detail.soortHypotheekAfgeleid = 'Annuiteit' then 1

           when aqopi_detail.soortHypotheekAfgeleid = 'Lineair' then 2

           when aqopi_detail.soortHypotheekAfgeleid = 'Leven' then 5

           when aqopi_detail.soortHypotheekAfgeleid = 'Bankspaarhypotheek' then 9

           when aqopi_detail.soortHypotheekAfgeleid = 'Spaar' then 4

           when aqopi_detail.soortHypotheekAfgeleid = 'Aflosvrij' then 0

           when aqopi_detail.soortHypotheekAfgeleid = 'Krediet' then 3

           when aqopi_detail.soortHypotheekAfgeleid = 'Belegging' then 6

           when aqopi_detail.soortHypotheekAfgeleid = 'Hybride' then 7

             else 1

           end

    from aqopiapp.t_mbd_hypotheek aqopi_detail

         join (                     

           select aqopi.header_rid

             from aqopiapp.t_mbd_hypotheek aqopi

                  join aqopiapp.t_aqopiapp_hypdatabase a_h

                    on a_h.header_rid = aqopi.header_rid

                   and a_h.aqopi_id = aqopi.hypotheek_id   

                       join aqopiapp.t_transaction trs

                         on trs.header_rid = a_h.header_rid                 

            where trs.transaction_id = v_transaction_id

            group

               by aqopi.header_rid

         ) as aqopi_set

           on aqopi_set.header_rid = aqopi_detail.header_rid 

   order

      by aqopi_detail.hypotheek_id

   limit 0, 1

    into v_loanpart_1

       , v_interest_1

       , v_loantype_1;

    

  select aqopi_detail.eindstand 

       , aqopi_detail.rentepercentageBerekend

       , case 

           when aqopi_detail.soortHypotheekAfgeleid = 'Annuiteit' then 1

           when aqopi_detail.soortHypotheekAfgeleid = 'Lineair' then 2

           when aqopi_detail.soortHypotheekAfgeleid = 'Leven' then 5

           when aqopi_detail.soortHypotheekAfgeleid = 'Bankspaarhypotheek' then 9

           when aqopi_detail.soortHypotheekAfgeleid = 'Spaar' then 4

           when aqopi_detail.soortHypotheekAfgeleid = 'Aflosvrij' then 0

           when aqopi_detail.soortHypotheekAfgeleid = 'Krediet' then 3

           when aqopi_detail.soortHypotheekAfgeleid = 'Belegging' then 6

           when aqopi_detail.soortHypotheekAfgeleid = 'Hybride'then 7

             else 1

           end

    from aqopiapp.t_mbd_hypotheek aqopi_detail

         join (                     

           select aqopi.header_rid

             from aqopiapp.t_mbd_hypotheek aqopi

                  join aqopiapp.t_aqopiapp_hypdatabase a_h

                    on a_h.header_rid = aqopi.header_rid

                   and a_h.aqopi_id = aqopi.hypotheek_id   

                       join aqopiapp.t_transaction trs

                         on trs.header_rid = a_h.header_rid                 

            where trs.transaction_id = v_transaction_id

            group

               by aqopi.header_rid

         ) as aqopi_set

           on aqopi_set.header_rid = aqopi_detail.header_rid   

   order

      by aqopi_detail.hypotheek_id

   limit 1, 1

    into v_loanpart_2

       , v_interest_2

       , v_loantype_2;    

         

  select aqopi_detail.eindstand 

       , aqopi_detail.rentepercentageBerekend

       , case 

           when aqopi_detail.soortHypotheekAfgeleid = 'Annuiteit' then 1

           when aqopi_detail.soortHypotheekAfgeleid = 'Lineair' then 2

           when aqopi_detail.soortHypotheekAfgeleid = 'Leven' then 5

           when aqopi_detail.soortHypotheekAfgeleid = 'Bankspaarhypotheek' then 9

           when aqopi_detail.soortHypotheekAfgeleid = 'Spaar' then 4

           when aqopi_detail.soortHypotheekAfgeleid = 'Aflosvrij' then 0

           when aqopi_detail.soortHypotheekAfgeleid = 'Krediet' then 3

           when aqopi_detail.soortHypotheekAfgeleid = 'Belegging' then 6

           when aqopi_detail.soortHypotheekAfgeleid = 'Hybride'then 7

             else 1

           end

    from aqopiapp.t_mbd_hypotheek aqopi_detail

         join (                     

           select aqopi.header_rid

             from aqopiapp.t_mbd_hypotheek aqopi

                  join aqopiapp.t_aqopiapp_hypdatabase a_h

                    on a_h.header_rid = aqopi.header_rid

                   and a_h.aqopi_id = aqopi.hypotheek_id   

                       join aqopiapp.t_transaction trs

                         on trs.header_rid = a_h.header_rid                 

            where trs.transaction_id = v_transaction_id

            group

               by aqopi.header_rid

         ) as aqopi_set

           on aqopi_set.header_rid = aqopi_detail.header_rid   

   order

      by aqopi_detail.hypotheek_id

   limit 2, 1

    into v_loanpart_3

       , v_interest_3

       , v_loantype_3;    

         

  select aqopi_detail.eindstand 

       , aqopi_detail.rentepercentageBerekend

       , case 

           when aqopi_detail.soortHypotheekAfgeleid = 'Annuiteit' then 1

           when aqopi_detail.soortHypotheekAfgeleid = 'Lineair' then 2

           when aqopi_detail.soortHypotheekAfgeleid = 'Leven' then 5

           when aqopi_detail.soortHypotheekAfgeleid = 'Bankspaarhypotheek' then 9

           when aqopi_detail.soortHypotheekAfgeleid = 'Spaar' then 4

           when aqopi_detail.soortHypotheekAfgeleid = 'Aflosvrij' then 0

           when aqopi_detail.soortHypotheekAfgeleid = 'Krediet' then 3

           when aqopi_detail.soortHypotheekAfgeleid = 'Belegging' then 6

           when aqopi_detail.soortHypotheekAfgeleid = 'Hybride'then 7

             else 1

           end

    from aqopiapp.t_mbd_hypotheek aqopi_detail

         join (                     

           select aqopi.header_rid

             from aqopiapp.t_mbd_hypotheek aqopi

                  join aqopiapp.t_aqopiapp_hypdatabase a_h

                    on a_h.header_rid = aqopi.header_rid

                   and a_h.aqopi_id = aqopi.hypotheek_id   

                       join aqopiapp.t_transaction trs

                         on trs.header_rid = a_h.header_rid                 

            where trs.transaction_id = v_transaction_id

            group

               by aqopi.header_rid

         ) as aqopi_set

           on aqopi_set.header_rid = aqopi_detail.header_rid   

   order

      by aqopi_detail.hypotheek_id

   limit 3, 1

    into v_loanpart_4

       , v_interest_4

       , v_loantype_4;            

        

  /*

  // Vul hypdatabase op basis van het log

  */

  update hypdatabase.huidiganalyseonderpand dataset

         join aqopiapp.t_aqopiapp_hypdatabase a_h

           on a_h.hypdatabase_object_id = dataset.ObjectID

          and a_h.aqopi_table_name = 't_mbd_hypotheek'

              join aqopiapp.t_mbd_hypotheek aqopi

                on aqopi.hypotheek_id = a_h.aqopi_id

              join aqopiapp.t_transaction trs

                on trs.header_rid = a_h.header_rid

     set dataset.HuidigeWoonSituatieClient = 1 -- koopwoning

       , dataset.hypotheekNummer = aqopi.rekNr

       , dataset.geldverstrekker = aqopi.maatschappijAfgeleid

       , dataset.Deel1Box1 = v_loanpart_1

       , dataset.Deel1Rente = v_interest_1

       , dataset.Deel1Soort = v_loantype_1

       , dataset.Deel2Box1 = v_loanpart_2

       , dataset.Deel2Rente = v_interest_2

       , dataset.Deel2Soort = v_loantype_2

       , dataset.Deel3Box1 = v_loanpart_3

       , dataset.Deel3Rente = v_interest_3

       , dataset.Deel3Soort = v_loantype_3

       , dataset.Deel4Box1 = v_loanpart_4

       , dataset.Deel4Rente = v_interest_4

       , dataset.Deel4Soort = v_loantype_4

   where trs.transaction_id = v_transaction_id;

  

  select v_loanpart_1 as loanpart_1

       , v_interest_1 as interest_1

       , v_loantype_1 as loantype_1

       , v_loanpart_2 as loanpart_2

       , v_interest_2 as interest_2

       , v_loantype_2 as loantype_2

       , v_loanpart_3 as loanpart_3

       , v_interest_3 as interest_3

       , v_loantype_3 as loantype_3

       , v_loanpart_4 as loanpart_4

       , v_interest_4 as interest_4

       , v_loantype_4 as loantype_4;

end ;;
