CREATE DEFINER=`finix_owner`@`localhost` PROCEDURE `p_process_mbd_premie_lijfrente`(

  a_guid varchar(255)

)
begin

  /*

  // Proc inserts latest aqopi values 

  //   of aqopiapp.t_mbd_bankrekening

  //   in hypdatabase.huidiganalysebestaandvermogen

  //

  // Log is saved in aqopiapp.t_aqopiapp_hypdatabase

  */

  

  declare v_transaction_id int;

  declare v_inserted_rows int;

  declare v_rows int;

  

  declare exit handler

    for sqlstate '40001' -- (ER_LOCK_DEADLOCK) Retry when deadlock occured

    begin                          

      do sleep(1);

      call aqopiapp.p_process_mbd_premie_lijfrente(a_guid); 

    end;

  

  set max_sp_recursion_depth=255;     

  /*

  // Maak een transactie op basis van de meest recente header van de guid

  */

  insert 

    into aqopiapp.t_transaction 

       (  header_rid

       )

  select aqopi_header.header_id

    from (

	  select max(header_id) as header_id

	       , finsave_guid

	    from aqopiapp.t_header 

	   where data_type = 'MBD'

       group

          by finsave_guid

    ) as aqopi_header

   where aqopi_header.finsave_guid = a_guid;

  

  select last_insert_id() into v_transaction_id;

  

  /*

  // Vul de log met de aqopi-herkomst en het hypdatabase-doel

  */  

  insert

    into aqopiapp.t_aqopiapp_hypdatabase 

       ( header_rid

	   , aqopi_table_name 

	   , aqopi_id

	   , hypdatabase_table_name 

	   , hypdatabase_object_id

	   )

  select trs.header_rid

       , 't_mbd_premie_lijfrente'

       , aqopi.premie_lijfrente_id

       , 'lijfrente'

       , finsave.f_get_hypdatabase_object_id()

    from aqopiapp.t_transaction trs

	     join aqopiapp.t_mbd_premie_lijfrente aqopi

	       on aqopi.header_rid = trs.header_rid

  where trs.transaction_id = v_transaction_id

    and not exists (

          select 1 

            from aqopiapp.t_aqopiapp_hypdatabase a_h

           where a_h.aqopi_table_name = 't_mbd_premie_lijfrente'

             and a_h.aqopi_id = aqopi.premie_lijfrente_id

        );

        

  /*

  // Vul hypdatabase op basis van het log

  */

  insert

    into hypdatabase.lijfrente 

       ( ObjectID

	   , ObjectRef 

	   , FieldRef

       , OpbouwProductNaam

	   , OpbouwMaatschappij 

	   , OpbouwAankoopPremie

       , OpbouwPolisnummer

	   , OpbouwTermijn 

	   )

  select a_h.hypdatabase_object_id

       , voorziening.ObjectID 

	   , voorziening.BestaandeLijfrentesNew

	   , aqopi.label

	   , aqopi.label

       , aqopi.betPremies

       , aqopi.polisRekNr

       , 5 -- Jaar, belastingen is een jaaropgave

    from hypdatabase.t_hypotheek hyp 

	     join hypdatabase.huidigesituatie hs

	       on hs.ObjectRef = hyp.ObjectID

	      and hs.FieldRef = hyp.HSID

		      join hypdatabase.huidiganalysebestaandevoorzieningen voorziening 

			    on voorziening.ObjectRef = hs.ObjectID

		       and voorziening.FieldRef = hs.BestaandeVoorzieningenGegevens

	     join aqopiapp.t_transaction trs

           on trs.transaction_id = v_transaction_id

              join aqopiapp.t_aqopiapp_hypdatabase a_h 

                on a_h.header_rid = trs.header_rid

               and a_h.aqopi_table_name = 't_mbd_premie_lijfrente'

                   join aqopiapp.t_mbd_premie_lijfrente aqopi 

                     on aqopi.premie_lijfrente_id = a_h.aqopi_id

              join aqopiapp.t_header h

                on h.header_id = trs.header_rid

               and hyp.hypotheekId = h.finsave_guid

  where not exists (

          select 1 

            from hypdatabase.huidiganalysebestaandvermogen 

           where ObjectID = a_h.hypdatabase_object_id

        );

        

 select row_count() into v_inserted_rows;



  /*

  // Verwijder voorgaande uploads van dezelfde userHash (zelfde digid)

  */

  delete

    from hypdatabase.lijfrente

   where ObjectID in (

           select a_h.hypdatabase_object_id

             from aqopiapp.t_aqopiapp_hypdatabase a_h

                  join aqopiapp.t_header hdr 

                    on hdr.header_id = a_h.header_rid

                       join aqopiapp.t_header latest_hdr

                         on latest_hdr.user_hash = hdr.user_hash

                            join t_transaction trs 

                              on trs.header_rid = latest_hdr.header_id

            where a_h.aqopi_table_name = 't_mbd_premie_lijfrente'

              and trs.transaction_id = v_transaction_id

              and hdr.header_id != latest_hdr.header_id                          

         );

         

  /*

  // Bepaal hoeveel lijfrentes er nu zijn, tbv windows client en finsave ui

  */

  select count(1)

    from hypdatabase.t_hypotheek hyp 

         join hypdatabase.huidigesituatie hs

           on hs.ObjectRef = hyp.ObjectID

          and hs.FieldRef = hyp.HSID

              join hypdatabase.huidiganalysebestaandevoorzieningen voorziening 

                on voorziening.ObjectRef = hs.ObjectID

               and voorziening.FieldRef = hs.BestaandeVoorzieningenGegevens

                   join hypdatabase.lijfrente dataset

                     on dataset.ObjectRef = voorziening.ObjectID

                    and dataset.FieldRef = voorziening.BestaandeLijfrentesNew

   where hyp.hypotheekId = a_guid

     and dataset.OpbouwProductNaam is not null

     and dataset.OpbouwAankoopPremie is not null

    into v_rows;

  

  /*

  // Markeer het aantal zichtbare rijen tbv clients.  Ja. Dit is niet fraai.

  */ 

  update hypdatabase.t_hypotheek hyp 

	     join hypdatabase.huidigesituatie hs

	       on hs.ObjectRef = hyp.ObjectID

	      and hs.FieldRef = hyp.HSID

		      join hypdatabase.huidiganalysebestaandevoorzieningen voorziening 

			    on voorziening.ObjectRef = hs.ObjectID

		       and voorziening.FieldRef = hs.BestaandeVoorzieningenGegevens

              join aqopiapp.t_header h

                on h.finsave_guid = hyp.hypotheekId

	               join aqopiapp.t_transaction trs

                     on trs.header_rid = h.header_id

     set voorziening.AantalBestaandeLijfrentesNew = v_rows

   where trs.transaction_id = v_transaction_id;         

   

  /*

  // delete empty rows in finsave. (can be created by windows client, they will mess up Aantal-counter)

  */

  delete target

    from hypdatabase.lijfrente target

         join (

           select dataset.ObjectID

             from hypdatabase.t_hypotheek hyp 

                  join hypdatabase.huidigesituatie hs

                    on hs.ObjectRef = hyp.ObjectID

                   and hs.FieldRef = hyp.HSID

                       join hypdatabase.huidiganalysebestaandevoorzieningen voorziening 

                         on voorziening.ObjectRef = hs.ObjectID

                        and voorziening.FieldRef = hs.BestaandeVoorzieningenGegevens

                            join hypdatabase.lijfrente dataset

                              on dataset.ObjectRef = voorziening.ObjectID

                             and dataset.FieldRef = voorziening.BestaandeLijfrentesNew

            where hyp.hypotheekId = a_guid

              and dataset.OpbouwProductNaam is null

              and dataset.OpbouwAankoopPremie is null

         ) as dataset

           on dataset.ObjectID = target.ObjectID;   

  

  select v_inserted_rows;

end ;;
DELIMITER ;
