CREATE DEFINER=`finix_owner`@`localhost` PROCEDURE `p_process_moh_kind`(

  a_guid varchar(255)

)
begin

  /*

  // Proc inserts latest aqopi values 

  //   of aqopiapp.t_moh_kind

  //   in hypdatabase.huidiganalysekinderen

  //

  // Log is saved in aqopiapp.t_aqopiapp_hypdatabase

  */

  

  declare v_transaction_id int;

  declare v_inserted_rows int;

  

  declare exit handler

    for sqlstate '40001' -- (ER_LOCK_DEADLOCK) Retry when deadlock occured

    begin                          

      do sleep(1);

      call aqopiapp.p_process_moh_kind(a_guid); 

    end;

  

  set max_sp_recursion_depth=255;     

  /*

  // Maak een transactie op basis van de meest recente header van de guid

  */

  insert 

    into aqopiapp.t_transaction 

       (  header_rid

       )

  select aqopi_header.header_id

    from (

	  select max(header_id) as header_id

	       , finsave_guid

	    from aqopiapp.t_header 

	   where data_type = 'MOH'

       group

          by finsave_guid

    ) as aqopi_header

   where aqopi_header.finsave_guid = a_guid;

  

  select last_insert_id() into v_transaction_id;

  

  /*

  // Vul de log met de aqopi-herkomst en het hypdatabase-doel

  */  

  insert

    into aqopiapp.t_aqopiapp_hypdatabase 

       ( header_rid

	   , aqopi_table_name 

	   , aqopi_id

	   , hypdatabase_table_name 

	   , hypdatabase_object_id

	   )

  select trs.header_rid

       , 't_moh_kind'

       , aqopi.kind_id

       , 'huidiganalysekinderen'

       , finsave.f_get_hypdatabase_object_id()

    from aqopiapp.t_transaction trs

	     join aqopiapp.t_moh_kind aqopi

	       on aqopi.header_rid = trs.header_rid

  where trs.transaction_id = v_transaction_id

    and not exists (

          select 1 

            from aqopiapp.t_aqopiapp_hypdatabase a_h

           where a_h.aqopi_table_name = 't_moh_kind'

             and a_h.aqopi_id = aqopi.kind_id

        );

        

  /*

  // Vul hypdatabase op basis van het log

  */

  insert

    into hypdatabase.huidiganalysekinderen 

       ( ObjectID

	   , ObjectRef 

	   , FieldRef

       , Roepnaam

       , Voorletters 

       , Geboortedatum 

       , Geslacht

       , vnmVoluit

       , Voorvoegsels

       , Achternaam

	   )

  select a_h.hypdatabase_object_id

       , haa.ObjectID

       , haa.KinderenGegevens

       , case 

           when position(' ' in aqopi.voornamen) > 0 

             then substring(aqopi.voornamen, 1, position(' ' in aqopi.voornamen) - 1)

             else aqopi.voornamen

           end

       , substring(aqopi.voornamen, 1, 1)

       , str_to_date(aqopi.geboortedatum,'%d-%m-%Y')

       , case when aqopi.geslacht = 'Vrouw' then 1 else 0 end

       , aqopi.voornamen

       , aqopi.voorvoegselsGeslachtsnaam

       , aqopi.geslachtsnaam

    from hypdatabase.t_hypotheek hyp 

         join hypdatabase.huidigesituatie hs

           on hs.ObjectRef = hyp.ObjectID

          and hs.FieldRef = hyp.HSID

              join hypdatabase.huidiganalysealgemeen haa 

                on haa.ObjectRef = hs.ObjectID

               and haa.FieldRef = hs.ALGID  

	     join aqopiapp.t_transaction trs

           on trs.transaction_id = v_transaction_id

              join aqopiapp.t_aqopiapp_hypdatabase a_h 

                on a_h.header_rid = trs.header_rid

               and a_h.aqopi_table_name = 't_moh_kind'

                   join aqopiapp.t_moh_kind aqopi 

                     on aqopi.kind_id = a_h.aqopi_id

              join aqopiapp.t_header h

                on h.header_id = trs.header_rid

               and hyp.hypotheekId = h.finsave_guid

  where not exists (

          select 1 

            from hypdatabase.huidiganalysekinderen 

           where ObjectID = a_h.hypdatabase_object_id

        )

    and not exists (

          -- if the kid exists dont create it. it might origin from the partner

          select 1 

            from hypdatabase.t_hypotheek hyp 

                 join hypdatabase.huidigesituatie hs

                   on hs.ObjectRef = hyp.ObjectID

                  and hs.FieldRef = hyp.HSID

                      join hypdatabase.huidiganalysealgemeen haa 

                        on haa.ObjectRef = hs.ObjectID

                       and haa.FieldRef = hs.ALGID

                           join hypdatabase.huidiganalysekinderen hak

                             on hak.ObjectRef = haa.ObjectID

                            and hak.FieldRef = haa.KinderenGegevens

           where hak.Geboortedatum = str_to_date(aqopi.geboortedatum,'%d-%m-%Y')

             and hak.vnmVoluit = aqopi.voornamen

             and hyp.hypotheekId = h.finsave_guid

        );

        

  select row_count() into v_inserted_rows;



  /*

  // Since we are not inserting no matter what, we also dont delete former inserts

  */ 

  

  select v_inserted_rows;

end ;;
DELIMITER ;
