CREATE DEFINER=`finix_owner`@`localhost` PROCEDURE `p_process_moh_partner`(

  a_guid varchar(255)

)
begin

  /*

  // Proc inserts latest aqopi values 

  //   of aqopiapp.t_moh_partner

  //   in hypdatabase.huidiganalysealgemeen

  //

  // Log is saved in aqopiapp.t_aqopiapp_hypdatabase

  */

  

  declare v_transaction_id int;

  

  declare exit handler

    for sqlstate '40001' -- (ER_LOCK_DEADLOCK) Retry when deadlock occured

    begin                          

      do sleep(1);

      call aqopiapp.p_process_moh_partner(a_guid); 

    end;

  

  set max_sp_recursion_depth=255;     

  /*

  // Maak een transactie op basis van de meest recente header van de guid

  */

  insert 

    into aqopiapp.t_transaction 

       (  header_rid

       )

  select aqopi_header.header_id

    from (

	  select max(header_id) as header_id

	       , finsave_guid

	    from aqopiapp.t_header 

	   where data_type = 'MOH'

       group

          by finsave_guid

    ) as aqopi_header

   where aqopi_header.finsave_guid = a_guid;

  

  select last_insert_id() into v_transaction_id;

  

  /*

  // Vul de log met de aqopi-herkomst en het hypdatabase-doel

  // Dit betreft een update dus record bestaat al in FinSave.

  */  

  insert

    into aqopiapp.t_aqopiapp_hypdatabase 

       ( header_rid

	   , aqopi_table_name 

	   , aqopi_id

	   , hypdatabase_table_name 

	   , hypdatabase_object_id

	   )

  select trs.header_rid

       , 't_moh_partner'

       , aqopi.partner_id

       , 'huidiganalysealgemeen'

       , dataset.ObjectID

    from aqopiapp.t_transaction trs

	     join (

           -- dit moet er 1 zijn, voor  de zekerheid zetten we hier een groupby omheen en pakken de laatste

           select header_rid

                , max(partner_id) as partner_id

             from aqopiapp.t_moh_partner 

            group

               by header_rid

         ) as aqopi 

	       on aqopi.header_rid = trs.header_rid

         join aqopiapp.t_header hdr

           on hdr.header_id = trs.header_rid

              join hypdatabase.t_hypotheek hyp 

                on hyp.hypotheekId = hdr.finsave_guid

	               join hypdatabase.huidigesituatie hs

	                 on hs.ObjectRef = hyp.ObjectID

	                and hs.FieldRef = hyp.HSID

                        join hypdatabase.huidiganalysealgemeen dataset 

                          on dataset.ObjectRef = hs.ObjectID

                         and dataset.FieldRef = hs.ALGID

  where trs.transaction_id = v_transaction_id;

        

  /*

  // Ververs hypdatabase op basis van het log

  */

  update hypdatabase.huidiganalysealgemeen dataset

         join aqopiapp.t_aqopiapp_hypdatabase a_h

           on a_h.hypdatabase_object_id = dataset.ObjectID

          and a_h.aqopi_table_name = 't_moh_partner'

              join aqopiapp.t_moh_partner aqopi

                on aqopi.partner_id = a_h.aqopi_id

              join aqopiapp.t_transaction trs

                on trs.header_rid = a_h.header_rid

                   join aqopiapp.t_header h

                     on h.header_id = trs.header_rid

     set dataset.vnaamPnr = case when h.is_partner = 0 then concat(upper(substring(aqopi.voornamen, 1, 1)), '.') else dataset.vnaamPnr end

       , dataset.vnmVoluitPnr = case when h.is_partner = 0 then aqopi.voornamen else dataset.vnmVoluitPnr end

       , dataset.vvoegselPnr = case when h.is_partner = 0 then aqopi.voorvoegselsGeslachtsnaam else dataset.vvoegselPnr end

       , dataset.anaamPnr = case when h.is_partner = 0 then aqopi.geslachtsnaam else dataset.anaamPnr end

       , dataset.GeboortenaamPnr = case when h.is_partner = 0 then aqopi.geslachtsnaam else dataset.GeboortenaamPnr end

       , dataset.GeboortePlaatsPnr = case when h.is_partner = 0 then aqopi.geboorteplaats else dataset.GeboortePlaatsPnr end

       , dataset.geslPnr = case when h.is_partner = 0 then case when aqopi.geslacht = 'Man' then 0 else 1 end else dataset.geslPnr end

       , dataset.SofinummerPnr = case when h.is_partner = 0 then aqopi.burgerservicenummer else dataset.SofinummerPnr end

       , dataset.gebdatPnr = case when h.is_partner = 0 then str_to_date(aqopi.geboortedatum,'%d-%m-%Y') else dataset.gebdatPnr end

       , dataset.vnaamCl = case when h.is_partner = 1 then concat(upper(substring(aqopi.voornamen, 1, 1)), '.') else dataset.vnaamCl end

       , dataset.vnmVoluitCl = case when h.is_partner = 1 then aqopi.voornamen else dataset.vnmVoluitCl end

       , dataset.vvoegselCl = case when h.is_partner = 1 then aqopi.voorvoegselsGeslachtsnaam else dataset.vvoegselCl end

       , dataset.anaamCl = case when h.is_partner = 1 then aqopi.geslachtsnaam else dataset.anaamCl end

       , dataset.GeboortenaamCl = case when h.is_partner = 1 then aqopi.geslachtsnaam else dataset.GeboortenaamCl end

       , dataset.GeboortePlaatsCl = case when h.is_partner = 1 then aqopi.geboorteplaats else dataset.GeboortePlaatsCl end

       , dataset.geslCl = case when h.is_partner = 1 then case when aqopi.geslacht = 'Man' then 0 else 1 end else dataset.geslCl end

       , dataset.SofinummerCl = case when h.is_partner = 1 then aqopi.burgerservicenummer else dataset.SofinummerCl end

       , dataset.gebdatCl = case when h.is_partner = 1 then str_to_date(aqopi.geboortedatum,'%d-%m-%Y') else dataset.gebdatCl end

       , dataset.burgStaat = 0 -- Gehuwd

   where trs.transaction_id = v_transaction_id;        

  

  select 0;

end ;;
DELIMITER ;
