CREATE DEFINER=`finix_owner`@`localhost` PROCEDURE `p_process_moh_woz`(

  a_guid varchar(255)

)
begin

  /*

  // Proc inserts latest aqopi values 

  //   of aqopiapp.t_moh_adres

  //   in hypdatabase.huidiganalysealgemeen

  //

  // Log is saved in aqopiapp.t_aqopiapp_hypdatabase

  */

  

  declare v_transaction_id int;

  

  declare exit handler

    for sqlstate '40001' -- (ER_LOCK_DEADLOCK) Retry when deadlock occured

    begin                          

      do sleep(1);

      call aqopiapp.p_process_moh_woz(a_guid); 

    end;

  

  set max_sp_recursion_depth=255;     

  /*

  // Maak een transactie op basis van de meest recente header van de guid

  */

  insert 

    into aqopiapp.t_transaction 

       (  header_rid

       )

  select aqopi_header.header_id

    from (

	  select max(header_id) as header_id

	       , finsave_guid

	    from aqopiapp.t_header 

	   where data_type = 'MOH'

       group

          by finsave_guid

    ) as aqopi_header

   where aqopi_header.finsave_guid = a_guid;

  

  select last_insert_id() into v_transaction_id;

  

  /*

  // Vul de log met de aqopi-herkomst en het hypdatabase-doel

  // Dit betreft een update dus record bestaat al in FinSave.

  */  

  insert

    into aqopiapp.t_aqopiapp_hypdatabase 

       ( header_rid

	   , aqopi_table_name 

	   , aqopi_id

	   , hypdatabase_table_name 

	   , hypdatabase_object_id

	   )

  select trs.header_rid

       , 't_moh_woz'

       , aqopi.woz_id

       , 'huidiganalyseonderpand'

       , case when hdr.is_partner = 1 then dataset_partner.ObjectID else dataset_client.ObjectID end

    from aqopiapp.t_transaction trs

	     join (

           -- finsave only supports one house. we pick the first

           select header_rid

                , min(woz_id) as woz_id

             from aqopiapp.t_moh_woz aqopi

            group

               by header_rid

         ) as aqopi

	       on aqopi.header_rid = trs.header_rid

         join aqopiapp.t_header hdr

           on hdr.header_id = trs.header_rid

              join hypdatabase.t_hypotheek hyp 

                on hyp.hypotheekId = hdr.finsave_guid

	               join hypdatabase.huidigesituatie hs

	                 on hs.ObjectRef = hyp.ObjectID

	                and hs.FieldRef = hyp.HSID

                        join ( 

                          select ObjectID

                               , ObjectRef

                               , FieldRef

                            from hypdatabase.huidiganalyseonderpand 

                        ) as dataset_client 

                          on dataset_client.ObjectRef = hs.ObjectID

                         and dataset_client.FieldRef = hs.HuidigeWoonsituatieClient

                        join ( 

                          select ObjectID

                               , ObjectRef

                               , FieldRef

                            from hypdatabase.huidiganalyseonderpand 

                        ) as dataset_partner 

                          on dataset_partner.ObjectRef = hs.ObjectID

                         and dataset_partner.FieldRef = hs.HuidigeWoonsituatiePartner

   where trs.transaction_id = v_transaction_id;

        

  /*

  // Ververs hypdatabase op basis van het log

  */

  update hypdatabase.huidiganalyseonderpand dataset

         join aqopiapp.t_aqopiapp_hypdatabase a_h

           on a_h.hypdatabase_object_id = dataset.ObjectID

          and a_h.aqopi_table_name = 't_moh_woz'

              join aqopiapp.t_moh_woz aqopi

                on aqopi.woz_id = a_h.aqopi_id

              join aqopiapp.t_transaction trs

                on trs.header_rid = a_h.header_rid

     set dataset.WOZ = aqopi.wozWaarde

       , dataset.VVW = case when ifNull(dataset.VVW, 0) > 0 then dataset.VVW else aqopi.wozWaarde end

   where trs.transaction_id = v_transaction_id;     

  

  select 0;

end ;;
