CREATE DEFINER=`finix_owner`@`localhost` PROCEDURE `p_process_mpo_ouderdom_pensioen_recht`(

  a_guid varchar(255)

)
begin

  /*

  // Proc inserts latest aqopi values 

  //   of aqopiapp.t_mpo_ouderdom_pensioen_recht

  //   in hypdatabase.upo

  //

  // Log is saved in aqopiapp.t_aqopiapp_hypdatabase

  */

  

  declare v_transaction_id int;

  declare v_inserted_rows int;

  declare v_rows int;

  

  declare exit handler

    for sqlstate '40001' -- (ER_LOCK_DEADLOCK) Retry when deadlock occured

    begin                          

      do sleep(1);

      call aqopiapp.p_process_mpo_ouderdom_pensioen(a_guid); 

    end;

  

  set max_sp_recursion_depth=255;     

  /*

  // Maak een transactie op basis van de meest recente header van de guid

  */

  insert 

    into aqopiapp.t_transaction 

       (  header_rid

       )

  select aqopi_header.header_id

    from (

	  select max(header_id) as header_id

	       , finsave_guid

	    from aqopiapp.t_header 

	   where data_type = 'MPO'

       group

          by finsave_guid

    ) as aqopi_header

   where aqopi_header.finsave_guid = a_guid;

  

  select last_insert_id() into v_transaction_id;

  

  /*

  // Vul de log met de aqopi-herkomst en het hypdatabase-doel

  */  

  insert

    into aqopiapp.t_aqopiapp_hypdatabase 

       ( header_rid

	   , aqopi_table_name 

	   , aqopi_id

	   , hypdatabase_table_name 

	   , hypdatabase_object_id

	   )

  select trs.header_rid

       , 't_mpo_ouderdom_pensioen_recht'

       , aqopi.ouderdom_pensioen_recht_id

       , 'upo'

       , finsave.f_get_hypdatabase_object_id()

    from aqopiapp.t_transaction trs

	     join aqopiapp.t_mpo_ouderdom_pensioen_recht aqopi

	       on aqopi.header_rid = trs.header_rid

  where trs.transaction_id = v_transaction_id

    and not exists (

          select 1 

            from aqopiapp.t_aqopiapp_hypdatabase a_h

           where a_h.aqopi_table_name = 't_mpo_ouderdom_pensioen_recht'

             and a_h.aqopi_id = aqopi.ouderdom_pensioen_recht_id

        );

        

  /*

  // Vul hypdatabase op basis van het log

  */

  insert

    into hypdatabase.upo 

       ( ObjectID

	   , ObjectRef 

	   , FieldRef

	   , upoWerkgever

	   , upoOP

	   , upoLeeftijd

	   , UpoLeeftijdInMnd

	   , UpoVroegPensioen

	   , UpoStartLeeftijdVroegPensioen

	   , UpoStartLeeftijdVroegPensioenInMnd

	   , UpoEindLeeftijdVroegPensioen

	   , UpoEindLeeftijdVroegPensioenInMnd

	   , upoNPvoorPD

	   , upoNPnaPD

	   , upoWPvoorPD

	   , upoWP18voorPD

	   )

  select a_h.hypdatabase_object_id

       , inkomen.ObjectID 

	   , inkomen.UPOIDCL

       , ouderdom.pensioenUitvoerder

	   , ouderdom.teBereiken

	   , ouderdom_h.vanafLeeftijdJaren

	   , ouderdom_h.vanafLeeftijdMaanden

	   , ifNull(vroeg.teBereiken, 0) 

	   , case when ifNull(vroeg.teBereiken, 0) > 0 then floor(vroeg.vanafLeeftijdInMaanden / 12) else 0 end 

	   , case when ifNull(vroeg.teBereiken, 0) > 0 then mod(vroeg.vanafLeeftijdInMaanden, 12) else 0 end

	   , case when ifNull(vroeg.teBereiken, 0) > 0 then ouderdom_h.vanafLeeftijdJaren else 0 end

	   , case when ifNull(vroeg.teBereiken, 0) > 0 then ouderdom_h.vanafLeeftijdMaanden else 0 end

	   , ifNull(partner.verzekerdBedrag, 0)

	   , ifNull(partner.verzekerdBedragNaPens, 0) 

	   , ifNull(wezen18.verzekerdBedrag, 0) 

	   , ifNull(wezen21 .verzekerdBedrag, 0)

    from hypdatabase.t_hypotheek hyp 

	     join hypdatabase.huidigesituatie hs

	       on hs.ObjectRef = hyp.ObjectID

	      and hs.FieldRef = hyp.HSID

              join hypdatabase.huidiganalyseinkomen inkomen 

                on inkomen.ObjectRef = hs.ObjectID

               and inkomen.FieldRef = hs.INKID               

	     join aqopiapp.t_transaction trs

           on trs.transaction_id = v_transaction_id

              join aqopiapp.t_aqopiapp_hypdatabase a_h 

                on a_h.header_rid = trs.header_rid

               and a_h.aqopi_table_name = 't_mpo_ouderdom_pensioen_recht'

                   join aqopiapp.t_mpo_ouderdom_pensioen_recht ouderdom 

                     on ouderdom.ouderdom_pensioen_recht_id = a_h.aqopi_id

                        join aqopiapp.t_mpo_ouderdom_pensioen ouderdom_h

                          on ouderdom_h.ouderdom_pensioen_id = ouderdom.ouderdom_pensioen_rid

                         and ouderdom_h.totLeeftijdJaren = 0 -- geen vroegpensioenen

                        left join (

                          select r.header_rid

                               , r.herkenningsNummer 

                               , r.pensioenUitvoerder

                               , max(teBereiken) as teBereiken

                               , min(vanafLeeftijdJaren * 12 + vanafLeeftijdMaanden) as vanafLeeftijdInMaanden

                            from aqopiapp.t_mpo_ouderdom_pensioen_recht r

                                 join aqopiapp.t_mpo_ouderdom_pensioen p 

                                   on p.ouderdom_pensioen_id = r.ouderdom_pensioen_rid

                           where p.totLeeftijdJaren > 0

                           group

                              by r.header_rid

                               , r.herkenningsNummer 

                               , r.pensioenUitvoerder

                        ) as vroeg

                          on vroeg.header_rid = ouderdom.header_rid

                         and vroeg.herkenningsNummer = ouderdom.herkenningsNummer 

                         and vroeg.pensioenUitvoerder = ouderdom.pensioenUitvoerder

                        left join (

                          select r.header_rid

                               , r.herkenningsNummer 

                               , r.pensioenUitvoerder

                               , max(verzekerdBedrag) as verzekerdBedrag

                               , max(verzekerdBedragNaPens) as verzekerdBedragNaPens

                            from aqopiapp.t_mpo_partner_pensioen_recht r

                                 join aqopiapp.t_mpo_partner_pensioen_recht_bedrag b

                                   on b.partner_pensioen_recht_rid = r.partner_pensioen_recht_id

                           group

                              by r.header_rid

                               , r.herkenningsNummer 

                               , r.pensioenUitvoerder

                        ) as partner

                          on partner.header_rid = ouderdom.header_rid

                         and partner.herkenningsNummer = ouderdom.herkenningsNummer 

                         and partner.pensioenUitvoerder = ouderdom.pensioenUitvoerder

                        left join (

                          select r.header_rid

                               , r.herkenningsNummer 

                               , r.pensioenUitvoerder

                               , max(verzekerdBedrag) as verzekerdBedrag

                            from aqopiapp.t_mpo_wezen_pensioen_recht r

                                 join aqopiapp.t_mpo_wezen_pensioen_recht_bedrag b

                                   on b.wezen_pensioen_recht_rid = r.wezen_pensioen_recht_id

                                 join aqopiapp.t_mpo_wezen_pensioen p

                                   on p.wezen_pensioen_id = r.wezen_pensioen_rid

                           where p.vanafLeeftijdJaren = 0

                             and p.totLeeftijdJaren >= 18

                           group

                              by r.header_rid

                               , r.herkenningsNummer 

                               , r.pensioenUitvoerder

                        ) as wezen18

                          on wezen18.header_rid = ouderdom.header_rid

                         and wezen18.herkenningsNummer = ouderdom.herkenningsNummer 

                         and wezen18.pensioenUitvoerder = ouderdom.pensioenUitvoerder

                        left join (

                          select r.header_rid

                               , r.herkenningsNummer 

                               , r.pensioenUitvoerder

                               , max(verzekerdBedrag) as verzekerdBedrag

                            from aqopiapp.t_mpo_wezen_pensioen_recht r

                                 join aqopiapp.t_mpo_wezen_pensioen_recht_bedrag b

                                   on b.wezen_pensioen_recht_rid = r.wezen_pensioen_recht_id

                                 join aqopiapp.t_mpo_wezen_pensioen p

                                   on p.wezen_pensioen_id = r.wezen_pensioen_rid

                           where p.vanafLeeftijdJaren <= 18

                             and p.totLeeftijdJaren >= 21

                           group

                              by r.header_rid

                               , r.herkenningsNummer 

                               , r.pensioenUitvoerder

                        ) as wezen21

                          on wezen21.header_rid = ouderdom.header_rid

                         and wezen21.herkenningsNummer = ouderdom.herkenningsNummer 

                         and wezen21.pensioenUitvoerder = ouderdom.pensioenUitvoerder

              join aqopiapp.t_header h

                on h.header_id = trs.header_rid

               and hyp.hypotheekId = h.finsave_guid

  where not exists (

          select 1 

            from hypdatabase.upo 

           where ObjectID = a_h.hypdatabase_object_id

        );      

        

 select row_count() into v_inserted_rows;



  /*

  // Verwijder voorgaande uploads van dezelfde userHash (zelfde digid)

  */

  delete

    from hypdatabase.upo

   where ObjectID in (

           select a_h.hypdatabase_object_id

             from aqopiapp.t_aqopiapp_hypdatabase a_h

                  join aqopiapp.t_header hdr 

                    on hdr.header_id = a_h.header_rid

                       join aqopiapp.t_header latest_hdr

                         on latest_hdr.user_hash = hdr.user_hash

                            join t_transaction trs 

                              on trs.header_rid = latest_hdr.header_id

            where a_h.aqopi_table_name = 't_mpo_ouderdom_pensioen_recht'

              and trs.transaction_id = v_transaction_id

              and hdr.header_id != latest_hdr.header_id                          

         ); 

  

  select v_inserted_rows;

end ;;
DELIMITER ;
