CREATE DEFINER=`finix_owner`@`localhost` PROCEDURE `p_process_uwv_algemeen`(

  a_guid varchar(255)

)
begin

  /*

  // Proc inserts latest aqopi values 

  //   of aqopiapp.t_uwv_algemeen

  //   in hypdatabase.huidiganalyseinkomen

  //

  // Log is saved in aqopiapp.t_aqopiapp_hypdatabase

  */

  

  declare v_transaction_id int;

  declare v_years_since_1998 int;

  declare v_years_since_2016 int;

  

  declare exit handler

    for sqlstate '40001' -- (ER_LOCK_DEADLOCK) Retry when deadlock occured

    begin                          

      do sleep(1);

      call aqopiapp.p_process_uwv_algemeen(a_guid); 

    end;

  

  set max_sp_recursion_depth=255;     

  /*

  // Maak een transactie op basis van de meest recente header van de guid

  */

  insert 

    into aqopiapp.t_transaction 

       (  header_rid

       )

  select aqopi_header.header_id

    from (

	  select max(header_id) as header_id

	       , finsave_guid

	    from aqopiapp.t_header 

	   where data_type = 'UWV'

       group

          by finsave_guid

    ) as aqopi_header

   where aqopi_header.finsave_guid = a_guid;

  

  select last_insert_id() into v_transaction_id;

  

  /*

  // Vul de log met de aqopi-herkomst en het hypdatabase-doel

  // Dit betreft een update dus record bestaat al in FinSave.

  */  

  insert

    into aqopiapp.t_aqopiapp_hypdatabase 

       ( header_rid

	   , aqopi_table_name 

	   , aqopi_id

	   , hypdatabase_table_name 

	   , hypdatabase_object_id

	   )

  select trs.header_rid

       , 't_uwv_algemeen'

       , aqopi.algemeen_id

       , 'huidiganalyseinkomen'

       , dataset.ObjectID

    from aqopiapp.t_transaction trs

	     join (

           -- dit moet er 1 zijn, voor  de zekerheid zetten we hier een groupby omheen en pakken de laatste

           select header_rid

                , max(algemeen_id) as algemeen_id

             from aqopiapp.t_uwv_algemeen 

            group

               by header_rid

         ) as aqopi 

	       on aqopi.header_rid = trs.header_rid

         join aqopiapp.t_header hdr

           on hdr.header_id = trs.header_rid

              join hypdatabase.t_hypotheek hyp 

                on hyp.hypotheekId = hdr.finsave_guid

	               join hypdatabase.huidigesituatie hs

	                 on hs.ObjectRef = hyp.ObjectID

	                and hs.FieldRef = hyp.HSID

                        join hypdatabase.huidiganalyseinkomen dataset 

                          on dataset.ObjectRef = hs.ObjectID

                         and dataset.FieldRef = hs.INKID

  where trs.transaction_id = v_transaction_id;

  

  select timestampdiff(year, '1998-01-01', current_timestamp)

    into v_years_since_1998;

    

  select timestampdiff(year, '2016-01-01', current_timestamp)

    into v_years_since_2016;        

    

  /*

  // Ververs hypdatabase op basis van het log

  */

  update hypdatabase.huidiganalyseinkomen dataset

         join aqopiapp.t_aqopiapp_hypdatabase a_h

           on a_h.hypdatabase_object_id = dataset.ObjectID

          and a_h.aqopi_table_name = 't_uwv_algemeen'

              join aqopiapp.t_uwv_algemeen aqopi

                on aqopi.algemeen_id = a_h.aqopi_id

              join aqopiapp.t_transaction trs

                on trs.header_rid = a_h.header_rid

                   join aqopiapp.t_header h

                     on h.header_id = trs.header_rid

     set dataset.JareneisWWCL = case 

                                  when h.is_partner = 0 

                                    then

                                      case when aqopi.arbeidsverledenInJaren > 4 then -1 else 0 end 

                                    else 

                                      dataset.JareneisWWCL

                                  end

       , dataset.ArbeidsverledenVanaf2016CL = case 

                                                when h.is_partner = 0 

                                                  then

                                                    case

                                                      when aqopi.arbeidsverledenInJaren >= v_years_since_2016 

                                                        then v_years_since_2016

                                                        else aqopi.arbeidsverledenInJaren

                                                      end

                                                  else

                                                    dataset.ArbeidsverledenVanaf2016CL

                                                end

       , dataset.ArbeidsverledenFeitelijkCL = case 

                                                when h.is_partner = 0 

                                                  then

                                                    case

                                                      when aqopi.arbeidsverledenInJaren <= v_years_since_2016 

                                                        then 0

                                                      when aqopi.arbeidsverledenInJaren >= v_years_since_1998 

                                                        then v_years_since_1998 - v_years_since_2016

                                                        else aqopi.arbeidsverledenInJaren - v_years_since_2016

                                                      end

                                                  else

                                                    dataset.ArbeidsverledenFeitelijkCL

                                                end

       , dataset.JareneisWWPA = case 

                                  when h.is_partner = 1

                                    then

                                      case when aqopi.arbeidsverledenInJaren > 4 then -1 else 0 end 

                                    else 

                                      dataset.JareneisWWPA

                                  end

       , dataset.ArbeidsverledenVanaf2016Pa = case 

                                                when h.is_partner = 1

                                                  then

                                                    case

                                                      when aqopi.arbeidsverledenInJaren >= v_years_since_2016 

                                                        then v_years_since_2016

                                                        else aqopi.arbeidsverledenInJaren

                                                      end

                                                  else

                                                    dataset.ArbeidsverledenVanaf2016Pa

                                                end

       , dataset.ArbeidsverledenFeitelijkPa = case 

                                                when h.is_partner = 1

                                                  then

                                                    case

                                                      when aqopi.arbeidsverledenInJaren <= v_years_since_2016 

                                                        then 0

                                                      when aqopi.arbeidsverledenInJaren >= v_years_since_1998 

                                                        then v_years_since_1998 - v_years_since_2016

                                                        else aqopi.arbeidsverledenInJaren - v_years_since_2016

                                                      end

                                                  else

                                                    dataset.ArbeidsverledenFeitelijkPa

                                                end                                            

   where trs.transaction_id = v_transaction_id;        

  

  select 0;

end ;;
DELIMITER ;
