CREATE DEFINER=`finix_owner`@`localhost` PROCEDURE `p_process_uwv_werkgever_slip`(

  a_guid varchar(255)

)
begin

  /*

  // Proc inserts latest aqopi values 

  //   of aqopiapp.t_uwv_werkgever_slip

  //   in hypdatabase.huidiglooninkomen

  //

  // Log is saved in aqopiapp.t_aqopiapp_hypdatabase

  */

  

  declare v_transaction_id int;

  declare v_updated_rows int;

  

  declare exit handler

    for sqlstate '40001' -- (ER_LOCK_DEADLOCK) Retry when deadlock occured

    begin                          

      do sleep(1);

      call aqopiapp.p_process_uwv_werkgever_slip(a_guid); 

    end;

  

  set max_sp_recursion_depth=255;     

  /*

  // Maak een transactie op basis van de meest recente header van de guid

  */

  insert 

    into aqopiapp.t_transaction 

       (  header_rid

       )

  select aqopi_header.header_id

    from (

	  select max(header_id) as header_id

	       , finsave_guid

	    from aqopiapp.t_header 

	   where data_type = 'UWV'

       group

          by finsave_guid

    ) as aqopi_header

   where aqopi_header.finsave_guid = a_guid;

  

  select last_insert_id() into v_transaction_id;

  

  /*

  // Vul de log met de aqopi-herkomst en het hypdatabase-doel

  // We doen een update van het eerste (met het laagste ObjectID) client loon (finix kent drie client lonen)

  // Na de update moet er een vlag (InkLoonCl zet eerste loon aan of uit) gezet worden dat dit loon zichtbaar is.

  */  

  insert

    into aqopiapp.t_aqopiapp_hypdatabase 

       ( header_rid

	   , aqopi_table_name 

	   , aqopi_id

	   , hypdatabase_table_name 

	   , hypdatabase_object_id

	   )

  select trs.header_rid

       , 't_uwv_werkgever_slip'

       , aqopi.werkgever_slip_id

       , 'huidiglooninkomen'

       , case when h.is_partner = 1 then dataset_partner.ObjectID else dataset_client.ObjectID end

    from aqopiapp.t_transaction trs

	     join ( 

           -- groupby, we ondersteunen maar 1 inkomen

           select min(detail.werkgever_slip_id) as werkgever_slip_id

                , detail.header_rid

             from t_uwv_werkgever_slip detail

                  join (

                    select header_rid

                         , date_format(

                             max(str_to_date(eindDatum,'%d-%m-%Y'))

                           , '%d-%m-%Y'

                           ) as eindDatum 

                      from t_uwv_werkgever_slip

                     group

                        by header_rid

                  ) as latest

                    on latest.header_rid = detail.header_rid

                   and latest.eindDatum = detail.eindDatum

            group

               by detail.header_rid

         ) as aqopi

	       on aqopi.header_rid = trs.header_rid

         join aqopiapp.t_header h 

           on h.header_id = trs.header_rid

              join hypdatabase.t_hypotheek hyp 

                on hyp.hypotheekId = h.finsave_guid

                   join hypdatabase.huidigesituatie hs

                     on hs.ObjectRef = hyp.ObjectID

                    and hs.FieldRef = hyp.HSID

                        join hypdatabase.huidiganalyseinkomen inkomen 

                          on inkomen.ObjectRef = hs.ObjectID

                         and inkomen.FieldRef = hs.INKID

                             join (

                               -- Pak het eerste inkomen van client

                               select ObjectRef

                                    , FieldRef

                                    , min(ObjectID) as ObjectID

                                 from hypdatabase.huidiglooninkomen 

                                group

                                   by ObjectRef

                                    , FieldRef

                             ) as dataset_client

                               on dataset_client.ObjectRef = inkomen.ObjectID

                              and dataset_client.FieldRef = inkomen.LoonInkomensClient

                             join (

                               -- Pak het eerste inkomen van partner

                               select ObjectRef

                                    , FieldRef

                                    , min(ObjectID) as ObjectID

                                 from hypdatabase.huidiglooninkomen 

                                group

                                   by ObjectRef

                                    , FieldRef

                             ) as dataset_partner

                               on dataset_partner.ObjectRef = inkomen.ObjectID

                              and dataset_partner.FieldRef = inkomen.LoonInkomensPartner

  where trs.transaction_id = v_transaction_id

    and not exists (

          select 1 

            from aqopiapp.t_aqopiapp_hypdatabase a_h

           where a_h.aqopi_table_name = 't_uwv_werkgever_slip'

             and a_h.aqopi_id = aqopi.werkgever_slip_id

        );                

        

  /*

  // Vul hypdatabase op basis van het log

  */

  update hypdatabase.huidiglooninkomen dataset

         join aqopiapp.t_aqopiapp_hypdatabase a_h

           on a_h.hypdatabase_object_id = dataset.ObjectID

          and a_h.aqopi_table_name = 't_uwv_werkgever_slip'

              join aqopiapp.t_uwv_werkgever_slip aqopi_slip

                on aqopi_slip.werkgever_slip_id = a_h.aqopi_id

                   join aqopiapp.t_uwv_werkgever aqopi_wgvr

                     on aqopi_wgvr.werkgever_id = aqopi_slip.werkgever_rid

              join aqopiapp.t_transaction trs

                on trs.header_rid = a_h.header_rid

     set dataset.Inkomen = aqopi_slip.brutoSalaris

       , dataset.naamWgvr = aqopi_wgvr.werkgever

       , dataset.Maand13 = case when aqopi_wgvr.dertiendeMaandAfgeleid > 0 then -1 else 0 end

       , dataset.InkTerm = case

                             when day(str_to_date(aqopi_slip.startDatum,'%d-%m-%Y')) = 1 and day(date_add(str_to_date(aqopi_slip.eindDatum,'%d-%m-%Y'), interval 1 day)) = 1

                               then 

                                 case

                                   when timestampdiff(month, str_to_date(aqopi_slip.startDatum,'%d-%m-%Y'), date_add(str_to_date(aqopi_slip.eindDatum,'%d-%m-%Y'), interval 1 day)) =  1 then  1 -- Maand

                                   when timestampdiff(month, str_to_date(aqopi_slip.startDatum,'%d-%m-%Y'), date_add(str_to_date(aqopi_slip.eindDatum,'%d-%m-%Y'), interval 1 day)) =  3 then  3 -- Kwartaal

                                   when timestampdiff(month, str_to_date(aqopi_slip.startDatum,'%d-%m-%Y'), date_add(str_to_date(aqopi_slip.eindDatum,'%d-%m-%Y'), interval 1 day)) =  6 then  4 -- Halfjaar

                                   when timestampdiff(month, str_to_date(aqopi_slip.startDatum,'%d-%m-%Y'), date_add(str_to_date(aqopi_slip.eindDatum,'%d-%m-%Y'), interval 1 day)) = 12 then  5 -- Jaar

                                     else dataset.InkTerm 

                                   end

                             when timestampdiff(day, str_to_date(aqopi_slip.startDatum,'%d-%m-%Y'), str_to_date(aqopi_slip.eindDatum,'%d-%m-%Y')) = 28 

                               then 2 -- 4 weken

                               else dataset.InkTerm 

                             end

   where trs.transaction_id = v_transaction_id; 

   

  /*

  // sync flags

  */

  update aqopiapp.t_transaction trs 

         join aqopiapp.t_header h

           on h.header_id = trs.header_rid

              join hypdatabase.t_hypotheek hyp 

                on hyp.hypotheekId = h.finsave_guid

                   join hypdatabase.huidigesituatie hs

                     on hs.ObjectRef = hyp.ObjectID

                    and hs.FieldRef = hyp.HSID

                        join hypdatabase.huidiganalyseinkomen inkomen 

                          on inkomen.ObjectRef = hs.ObjectID

                         and inkomen.FieldRef = hs.INKID

                             left join (

                               select -1 as flag

                                    , ObjectRef

                                    , FieldRef

                                 from hypdatabase.huidiglooninkomen

                                where ifNull(Inkomen, 0) > 0

                                group

                                   by ObjectRef

                                    , FieldRef

                             ) as loon_client

                               on loon_client.ObjectRef = inkomen.ObjectID

                              and loon_client.FieldRef = inkomen.LoonInkomensClient

                             left join (

                               select -1 as flag

                                    , ObjectRef

                                    , FieldRef

                                 from hypdatabase.huidiglooninkomen

                                where ifNull(Inkomen, 0) > 0

                                group

                                   by ObjectRef

                                    , FieldRef

                             ) as loon_partner

                               on loon_partner.ObjectRef = inkomen.ObjectID

                              and loon_partner.FieldRef = inkomen.LoonInkomensPartner

     set inkomen.InkLoonCl = ifNull(loon_client.flag, 0) 

       , inkomen.InkLoonPa = ifNull(loon_partner.flag, 0)

   where trs.transaction_id = v_transaction_id; 

             

  select row_count() into v_updated_rows;

  

  select v_updated_rows;

end ;;
